import React from 'react';
import './Root.css';
import Exercicio1 from './exercicio1/Exercicio1';
import Exercicio2 from './exercicio2/Exercicio2';
import Home from "./pages/Home";
import About from "./pages/About";

//import Exercicio2_1 from './exercicio2/Exercicio2_1';
//import Exercicio3 from './exercicio3/Exercicio3';
//import Exercicio3_1 from './exercicio3/Exercicio3_1';
//import Exercicio3_2 from './exercicio3/Exercicio3_2';

import {Route, BrowserRouter as Router, Switch, Link} from "react-router-dom";


//Functional Component or Stateless Component
const App = (props) => {

return (
    <div>
      <Router>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/">Calculator</Link>
            </li>
            <li>
              <Link to="/">ToDoList</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
          </ul>
        </nav>
        <Switch>
          <Route path="/" exact component={Home}/>
          <Route path="/calculator" component={Home}/>
          <Route path="/todolist" component={Home}/>
          <Route path="/about" component={About}/>
        </Switch>
      </Router>
    </div>
  )
}

export default App;
